INSERT INTO `fl` VALUES ('1', '32ban.mp4', '三（2）班 -- 我的好兄弟', '这里向同学们征简介...', '2018-12-31 16:59:37', '0');
INSERT INTO `fl` VALUES ('2', 'we.mp4', '我们都很现实，安静的把它看完', '当有一天我们突然忆起儿时的梦想，惨然一笑，便会发现早已时过境迁…那样纯真的年代，那样灿烂的梦想早已离我们而去。于是，我们明白：我们长大了！ 一瞬间的忧伤，转瞬即逝。当现实的理性终于战胜那一抹若隐若现的忧伤，我们想起，我们还有责任，想起了家人朋友的期待，想起了这无比现实的社会，想起了心中的不甘…于是，新的梦想终于形成…为了这梦想，我们一步步的走向了成熟和现实，我们开始越来越淡然，说些以前从不会说的话，做些以前从不会做的事，我们逐渐的忙碌起来，再不会追逐一些虚无缥缈的东西，比如说－爱情...', '2018-12-31 17:02:29', '0');
INSERT INTO `fl` VALUES ('3', 'wegoodgirl.mp4', '我们都是好孩子', '《我们都是好孩子》送给周莹，祝她天天开开心心的。还有，祝陈莉，每个人都幸福；祝彭奎，多赚大钱；祝钭小倩，每天都快乐！', '2018-12-31 17:06:23', '0');
INSERT INTO `fl` VALUES ('4', 'car.mp4', '那些年 -- 贾思文', '你个未成年小女孩越长越漂亮了...', '2018-12-31 17:09:44', '0');
INSERT INTO `fl` VALUES ('5', 'hzjc2018.mp4', '伟创聚赢2018晚会', '取材于伟创聚赢2018晚会相关照片以及其他照片，作于2018春节期间', '2018-12-31 17:14:32', '0');
INSERT INTO `fl` VALUES ('6', 'qs.mp4', '千硕 - 我们不一样', '永远记得，芙蓉姐在2018拓展活动中唱的一首《我们不一样》', '2019-01-17 14:05:02', '0');
INSERT INTO `fl` VALUES ('7', 'dbyxy.mp4', '东北一小院', '2014年11月21日晚八时许，孙彬彬同志在东北一小院豪饮一杯又一杯（不知道多少杯），大败精英组，无人可敌！', '2019-01-17 17:12:13', '0');
