INSERT INTO `user` VALUES ('2', '姚慧', '15995999049', 'yh123456', '2018-12-31 18:12:11', '0');
INSERT INTO `user` VALUES ('3', '马红涛', '15972222742', 'xm666555', '2018-12-31 21:55:33', '0');
INSERT INTO `xq_line` VALUES ('1', null, '</br></br><img src=\"/files/xq/2019_05/2019-05-04 15_55_11.jpg\" width=\"100%\"/></br></br>', null, '2019-05-04 15:55:58');
INSERT INTO `xq_line` VALUES ('2', '3', '我个人觉得一开始就把很优越的经济条件展现出来，是不合适的，因为这样更容易找到一些只看重经济条件的对象，简单的说，就是找到爱你的钱，不爱你的人的对象。然而这并不是我们想要的结果。', '继续', '2019-05-04 15:59:09');
INSERT INTO `xq_line` VALUES ('3', null, '但是我这么说，并不是说我的经济条件很优越，请不要误会。我只是想表示，我找对象，更偏重于“性格合得来”。我相信，感情好的两个人，就算经济条件一般般，比人家很有钱但是没什么感情甚至频频大吵小吵的两个人，要幸福很多。', null, '2019-05-04 15:59:09');
INSERT INTO `xq_line` VALUES ('4', '5', '我的要求其实也比较简单，大概就三点吧：不抽烟、不赌博、会过日子。', '继续', '2019-05-04 16:01:24');
INSERT INTO `xq_line` VALUES ('5', '6', '我觉得，女生如果是有点喜欢喝酒，没什么问题，比如有些喜欢喝啤酒的，很厉害，一次能喝好几瓶，或者直接以件为单位，有点豪放的感觉，女汉子型，这样性格的，一般不会为小事斤斤计较，就是不会小肚鸡肠。但是女生抽烟，可能有些人觉得无所谓，我个人却觉得是个很不好的习惯，所以抽烟的女生，请不要联系。', '继续', '2019-05-04 16:02:00');
INSERT INTO `xq_line` VALUES ('6', '7', '至于赌博，有喜欢去赌场或者其他方式赌博的，真的不考虑。那么平时和几个朋友、邻居、老同学打打牌，算不算呢？一般不算吧，和熟人打打牌，也没多大的输赢，像农村里，过年的时候，拜年拜完了，就约村里的几个好友，打打牌，很正常。但是有一点，有的人，被朋友约打牌，先要问一下打多大的，如果打得比较小，还嫌小不去，这种，就是有赌博的心理。', '继续', '2019-05-04 16:02:11');
INSERT INTO `xq_line` VALUES ('7', null, '最后，我相亲，就是以结婚为目的，我很希望找一个会过日子的。只是一个人是不是“会过日子”的，还得在一起慢慢相互了解。', null, '2019-05-04 16:02:11');
INSERT INTO `xq_line` VALUES ('8', '9', '其实这是电视剧里的一段台词，我改了点，新洲区，其实也没什么山的，新洲的道观景点那儿，也只能算一些小山，小的时候，去玩过，很久没去了，也不知道现在多大变化了...', '继续', '2019-05-04 16:09:37');
INSERT INTO `xq_line` VALUES ('9', null, '这里，应该是要拍一些照片的，都是文字说明，描述不了那些个风景，看来我这里还需要慢慢更新，什么时候回家一趟，拍一些照片，放上去', null, '2019-05-04 16:09:37');
INSERT INTO `xq_line` VALUES ('10', '11', '我就讲讲我们这个湾子的变化吧，记得很小的时候，家家户户都是小土房子（土砖砌的墙，少数是红砖砌的），没有楼房的，我家后面有一个院子，院子里种着一片竹林子，很多时候，我就是拿一个小铲子，去铲土玩...', '继续', '2019-05-04 16:24:10');
INSERT INTO `xq_line` VALUES ('11', '12', '我很喜欢夏天，因为可以不用穿衣服，睡觉不用穿，起来了也不用穿，出去玩还是不用穿（那个年代，好像没上学前班，就光溜着身体到处去野），太阳大了，我去水里面躲着，哈哈，那些年代的小池塘的里的水，很干净，我们可以在小池塘里用手挖泥巴，互扔，打泥巴仗，把整个小池塘都搅混了...', '继续', '2019-05-04 16:24:20');
INSERT INTO `xq_line` VALUES ('12', '13', '我也很喜欢冬天，因为会下雪，下好大好大的雪，雪年年都会下，但每次下雪，都能给我带来很多快乐，我童年里大部分的快乐，都是冬天里的雪带给我的，我很小却很抗冷，再多的雪，我也是玩不够的...', '继续', '2019-05-04 16:25:10');
INSERT INTO `xq_line` VALUES ('13', '88', '</br></br><img src=\"/files/xq/2019_05/2019-05-04 16_24_44.jpg\" width=\"100%\"/></br></br>', '继续13', '2019-05-14 14:41:04');
INSERT INTO `xq_line` VALUES ('14', '15', '因为我觉得我有网络技术的优势，我除了搞线下的广告业务，还可以搞网络的宣传推广业务', '这个要很多投资的吧', '2019-05-04 17:09:30');
INSERT INTO `xq_line` VALUES ('15', '16', '要租门面，也要买很多设备，是需要很多投资，不过家里人都是比较支持我的，开图文广告门店也是我家里提出来的', '那你估计什么时候开始做呢', '2019-05-04 17:09:47');
INSERT INTO `xq_line` VALUES ('16', '17', '这个也说不定，快的话，或许今年年底就突然回去搞了，因为这个事很久就有这个打算的了\r\n<p>慢的话，可能我继续在武汉上几年的班，这些都要看具体的实际情况</p>', '在新洲做这个市场好吗', '2019-05-04 17:10:05');
INSERT INTO `xq_line` VALUES ('17', '18', '近几年，城市外围正在大规模的建造高楼层的小区，城市面积扩展速度很快，所以我觉得我们这边的图文广告业务是呈现一个增长的趋势', '你专门考察过市场的吗', '2019-05-04 17:10:16');
INSERT INTO `xq_line` VALUES ('18', null, '也没有专门去考察，家乡的变化，一天天的都是看得到的，然后再稍加分析，就能够大概的知道基本行情了', null, '2019-05-04 17:10:16');
INSERT INTO `xq_line` VALUES ('19', '20', '然后，有孩子了，不能把全部精力用在为孩子赚钱，一定要注重孩子教育，掌握科学的教育孩子的方法很重要', '继续', '2019-05-04 17:11:17');
INSERT INTO `xq_line` VALUES ('20', null, '这些可能想得有点远，但是应该是最重要的，其他的事情，以后想到了，再慢慢加上去', null, '2019-05-04 17:11:17');
INSERT INTO `xq_line` VALUES ('21', '22', '再然后我感觉有好多东西要说，太多了，说不完，理一下思绪，突然又感觉没什么要说的。不过这还不是最要命的...', '最要命的是什么？', '2019-05-04 17:14:54');
INSERT INTO `xq_line` VALUES ('22', '23', '最要命的，是我准备开始写， 双手放在键盘上，定住了 -- 不知道从何处开始写！', '...', '2019-05-04 17:15:03');
INSERT INTO `xq_line` VALUES ('23', null, '我感觉这里有点难，先放一放，把其他内容加进去，再来写这里', null, '2019-05-04 17:15:03');
INSERT INTO `xq_line` VALUES ('24', '25', '她说过自己是单身的', '撒谎？', '2019-05-04 17:16:52');
INSERT INTO `xq_line` VALUES ('25', '26', '也不能算是撒谎，说来也话长，我从头开始讲吧', '最好是从认识开始讲', '2019-05-04 17:17:06');
INSERT INTO `xq_line` VALUES ('26', '27', '2015年，我在上海，应朋友之邀，参加一个聚会，聚会的人我基本是不认识的，我们先是吃了一顿烤鱼，然后唱歌去了', '然后呢', '2019-05-04 17:17:18');
INSERT INTO `xq_line` VALUES ('27', '28', 'KTV里玩“真心话和大冒险”的游戏，她在被提问“有没有男朋友”时，回答没有', '然后', '2019-05-04 17:18:10');
INSERT INTO `xq_line` VALUES ('28', '29', '几波游戏后，我被起哄者安排了一个“大冒险”，还非要我找个女生要QQ', '继续', '2019-05-04 17:18:20');
INSERT INTO `xq_line` VALUES ('29', '30', '莫名其妙的，我选择找她要，可能是感觉对她的好感度要高一点吧，其实当时我也没什么底，第一次见面，都没说什么话呢，就要联系方式，有些女生在这种时候，就喜欢为难一下男生，让男生很尴尬', '继续', '2019-05-04 17:18:31');
INSERT INTO `xq_line` VALUES ('30', '31', '但是让我意外的是，她直接就给了，很乖的那种，我心里有点小感激，接下来的其他游戏，以及唱歌，都很正常的进行着...', '继续', '2019-05-04 17:18:44');
INSERT INTO `xq_line` VALUES ('31', '32', '晚上，我想感谢一下她，没别的，真的没别的意思，就是想感谢一下她而已，我在QQ里找到她，正想着该怎么说，无意间就看到了她最近上传的一直图片，因为QQ就有这个功能，应该是在QQ相册里最近上传的图片，会被显示在个人页面里，虽然只是显示的尺寸比较小的预览图，但是这样的人物风景图，一下子就吸引到我了', '继续', '2019-05-04 17:18:55');
INSERT INTO `xq_line` VALUES ('32', '33', '那一张图片，应该是她去哪儿玩，别人给她拍的，图片中，有一个古式的小亭子，里面有石头桌椅，她坐在石椅上，手撑头做思考状，眼光像是在看着石桌边缘，又像是在看远方的风景，远处是延绵起伏的山，看不到边。\r\n<p>她那瀑布型长发自然下垂，白色连衣裙，裙梢那红绿相间的青椒图，给我的印象非常深，我想起了我的初恋...</p>', '继续', '2019-05-04 17:19:31');
INSERT INTO `xq_line` VALUES ('33', '34', '我在QQ里进入和她的聊天窗口，编辑一条消息：“你那张坐在小亭子里的照片，是在哪儿拍的啊，好像我初恋”，刚想点发送按钮，突然又想到，这种类似“像我初恋，像我同学”的撩妹台词，很容易引起反感，于是，改为“今天，谢谢你。”', '继续', '2019-05-04 17:19:44');
INSERT INTO `xq_line` VALUES ('34', '35', '一波初次相识的客套过后，感觉没什么话要说的了，我还是没提那张照片的事，今天，也就多了一个QQ好友而已', '继续', '2019-05-04 17:19:53');
INSERT INTO `xq_line` VALUES ('35', '36', '大概5分钟的样子，她又发来一条消息：“你是干什么工作的啊？”就是这一问，我们当天晚上，居然聊到转点，反正故事就这么开始了', '继续', '2019-05-04 17:20:03');
INSERT INTO `xq_line` VALUES ('36', '37', '然后，有那么一段时间，有那么一些地方，会出现一下我和她的身影。很开心，很快乐，像是无忧无虑的...', '继续', '2019-05-04 17:20:12');
INSERT INTO `xq_line` VALUES ('37', '38', '只是，每一段没有走向婚姻的爱情，都可以大致分为三个阶段：开始、发展、结束\r\n<p>开始，是让人很心动的，很向往的，很美好的</p>\r\n<p>发展，是让人很开心的，很幸福的</p>\r\n<p>而结束，一般都是让人很痛苦的</p>', '继续', '2019-05-04 17:20:21');
INSERT INTO `xq_line` VALUES ('38', '39', '我和她的相处，是没有问题的，直到有一天我发现她突然心事重重的，问了一下，她说没事，就是没休息好，然后，再过了一个多星期，提分手了', '继续', '2019-05-04 17:20:30');
INSERT INTO `xq_line` VALUES ('39', '40', '就是很突然，很坚决的那种，我很想了解一下是什么原因，她说她男朋友找她了，她说她男朋友和她是一个地方的，她说她不想嫁太远，她说她家里人都叫她回去...', '继续', '2019-05-04 17:20:39');
INSERT INTO `xq_line` VALUES ('40', '41', '好吧，我懂。', '继续', '2019-05-04 17:20:50');
INSERT INTO `xq_line` VALUES ('41', null, '我，又想起了我的初恋...', null, '2019-05-04 17:20:50');
INSERT INTO `xq_line` VALUES ('42', '43', '现在的我们已经到了谈婚论嫁的年龄，但我们仍然是单身。', '继续', '2019-05-04 17:22:26');
INSERT INTO `xq_line` VALUES ('43', '44', '当身边的同事朋友问及我们的时候，回答都是：婚姻是件大事不敢太草率了，所以选自己另一半的时候更多的是理智。', '继续', '2019-05-04 17:22:34');
INSERT INTO `xq_line` VALUES ('44', '45', '然而，好多没谈过恋爱的人还是期望自己能谈一场真正的恋爱，然后和自己心爱的人携手走入婚姻的殿堂。', '继续', '2019-05-04 17:22:41');
INSERT INTO `xq_line` VALUES ('45', '46', '但是，谈恋爱对于现在的我们来说已经成为一种奢侈...', '继续', '2019-05-04 17:23:38');
INSERT INTO `xq_line` VALUES ('46', null, '还是看视频吧：\r\n</br></br><video autoplay=\"autoplay\" controls=\"controls\" src=\"/files/fl/we.mp4\" width=\"100%\"></video></br></br>', null, '2019-05-04 17:23:38');
INSERT INTO `xq_line` VALUES ('47', null, '</br></br>很任性：</br><audio autoplay=\"autoplay\" loop=\"loop\" controls=\"controls\" src=\"/files/xq/2019_05/2019-05-04 17_31_28.mp3\">Your browser does not support music playback</audio></br></br>\r\n<p>走过看过路过都成了风景，爱过痛过哭过都成了回忆。先放手的人洒脱无谓，另一个就伤心寂寞。一辈子太长，爱与不爱心自知。何不把今日事，与来日下酒？</p>\r\n<p>很任性，送给大家</p>\r\n</br></br>\r\n<p>一个人很寂寞另一个很洒脱 </p>\r\n<p>谁先放开的手当初却没有说 </p>\r\n<p>以为感受到你那跳动的脉搏 </p>\r\n<p>也曾觉得分分合合没什么了不得 </p>\r\n<p>一个人的拥抱能转移给几个 </p>\r\n<p>简单温暖剩过一万次的承诺 </p>\r\n<p>天涯路太遥远谁会相伴走过 </p>\r\n<p>丢过幸福的人请和我一起唱情歌 </p>\r\n<p>很任性相爱过 </p>\r\n<p>很任性的执着 </p>\r\n<p>很任性的以为自己 </p>\r\n<p>放手时很洒脱 </p>\r\n<p>很任性流眼泪 </p>\r\n<p>很任性的哭着 </p>\r\n<p>很任性的拥抱 </p>\r\n<p>有多难得 </p>\r\n<p>一个人很寂寞另一个很洒脱 </p>\r\n<p>谁先放开的手当初却没有说 </p>\r\n<p>以为感受到你那跳动的脉搏 </p>\r\n<p>也曾觉得分分合合没什么了不得 </p>\r\n<p>一个人的拥抱能转移给几个 </p>\r\n<p>简单温暖剩过一万次的承诺 </p>\r\n<p>天涯路太遥远谁会相伴走过 </p>\r\n<p>丢过幸福的人请和我一起唱情歌 </p>\r\n<p>很任性相爱过 </p>\r\n<p>很任性的执着 </p>\r\n<p>很任性的以为自己 </p>\r\n<p>放手时很洒脱 </p>\r\n<p>很任性流眼泪 </p>\r\n<p>很任性的哭着 </p>\r\n<p>很任性的拥抱 </p>\r\n<p>有多难得 </p>\r\n<p>很任性相爱过 </p>\r\n<p>很任性的执着 </p>\r\n<p>很任性的以为自己 </p>\r\n<p>放手时很洒脱 </p>\r\n<p>很任性流眼泪 </p>\r\n<p>很任性的哭着 </p>\r\n<p>很任性的拥抱 </p>\r\n<p>有多难得 </p>\r\n<p>很任性相爱过 </p>\r\n<p>很任性的执着 </p>\r\n<p>很任性的以为自己 </p>\r\n<p>放手时很洒脱 </p>\r\n<p>很任性流眼泪 </p>\r\n<p>很任性的哭着 </p>\r\n<p>很任性的拥抱 </p>\r\n<p>有多难得 </p>\r\n<p>很任性的拥抱 </p>\r\n<p>有多难得 </p>', '', '2019-05-08 14:20:16');
INSERT INTO `xq_line` VALUES ('48', '49', '<p>当然还有另一种可能，无爱的婚姻，会让女人心灵扭曲。</p>\r\n<p>我们单位的某个主管，三十三岁结的婚。男方是相亲认识的，公务员。工资什么的也不错。女方家里是独女，房车存款皆有，父母已经退休，退休金比我工资还高的那种。</p>', '继续', '2019-05-08 16:54:39');
INSERT INTO `xq_line` VALUES ('49', '50', '两个人相亲半年结婚。双方领导在婚宴上都讲了话，那场婚宴是我见过最特别的婚宴，男方在努力的跟所有人应酬，女方也在努力拓展自己的人脉。整场婚宴下来，我基本没看到这二人的互动，他们都把自己的婚宴当成了工作。就像两个单位的年会联欢一样。', '继续', '2019-05-08 16:57:14');
INSERT INTO `xq_line` VALUES ('50', '51', '婚后两个人过的怎么样，谁都不知道。因为这位主管从来不提家里的事。等她后来生孩子了。我们就多少知道一些问题了。', '继续50', '2019-05-08 17:00:58');
INSERT INTO `xq_line` VALUES ('51', '52', '孩子病的时候，永远是她一个人在照顾，她请了好几个保姆，对每个保姆都很挑剔，在电话里用极恶毒的话去骂她孩子的保姆。如果不是心中有极大的阴郁纾解不开，一个成熟的、受过高等教育的、生在书香门第的、事业有成的女性，是不会容许自己在公共场所骂出那么难听的话的。那跟白雪公主里的毒皇后有什么区别？丑陋而恶俗。', '继续51', '2019-05-08 17:01:19');
INSERT INTO `xq_line` VALUES ('52', '53', '她丈夫明明很闲，比如我在健身中心运动时，就曾经看到她的丈夫跟同事悠闲的在跑步机上边慢跑边聊天，嘴里谈论的不是车就是游戏。跑完后去外面点餐，几个人在一起哈哈哈哈。我跟那位女主管还没熟悉到要为她抱打不平的地步，我也就没有上前去问他为什么不回家看看生病的孩子。', '继续52', '2019-05-08 17:01:29');
INSERT INTO `xq_line` VALUES ('53', '54', '那个孩子上幼儿园时，因为户口的问题，被公立幼儿园拒绝了，全程又都是这位主管自己想办法。她儿子终于进了她心中最好的幼儿园，但三天两头被请家长，被劝退。另一个也有孩子在那个幼儿园的同事跟我们说，这位主管的儿子在幼儿园里总是骂人，骂一些纯粹的脏口国骂。听到这，我们连虚伪的假笑都笑不出来。', '继续53', '2019-05-08 17:01:41');
INSERT INTO `xq_line` VALUES ('54', '55', '因为我们都明白，孩子是家庭的反射镜。如果他们两口子在家里不说脏话，孩子又从哪个渠道来接触这样的脏口粗话呢？一个外人看起来很体面的家庭，家里却用最粗俗的最让人不耻的语言去互相辱骂，那这样的婚姻，可真让人心累。', '继续54', '2019-05-08 17:07:28');
INSERT INTO `xq_line` VALUES ('55', '56', '这位主管婚后变的越来越自私，连最基本的表面公平公正都做不到了。', '继续55', '2019-05-08 17:07:40');
INSERT INTO `xq_line` VALUES ('56', '57', '我们单位有个久远流传下来的传统，就是逢节必过，为的是暖一暖员工的心。六一儿童节，单位也会搞活动，让有孩子的员工都带着孩子一起来参加，没孩子的年轻人，只要没结婚，也可以在六一这天，在领导面前当一把孩子。结婚却无孩儿的，那天负责为所有孩子们服务。单位会在儿童节这天出资给所有孩子们准备各种各样的礼物，也算是给员工的一个福利。因为这位女主管的孩子病了，不能参加，她不知道是脑子断弦了还是怎的，她把她那个部门的所有员工都派了工作下达了命令，要求大家一起干工作，不参加单位的这个活动。', '继续56', '2019-05-08 17:07:50');
INSERT INTO `xq_line` VALUES ('57', '58', '一时间怨声载道。这位主管被群嘲，也被上级批评教育开解了一顿。这件事就算这么结束了。', '继续57', '2019-05-08 17:08:05');
INSERT INTO `xq_line` VALUES ('58', '59', '去年夏天，单位办公楼装修，领导就组织大家趁这机会出去旅游渡个小假。有孩子的可以带孩子，没孩子的可以带对象或带父母。', '继续58', '2019-05-08 17:08:19');
INSERT INTO `xq_line` VALUES ('59', '60', '大家原本商量着，想等上学的孩子们20号那天期末考试结束再出发，好让有孩子的员工可以带着孩子一起去。对于这点，没有人反对。大家都有过童年，也都参加过父母单位的旅游活动，记忆都是美好的，所以就算自己没有孩子，也是支持单位这么做的，不就是多等几天吗？这几天正好做准备工作', '继续59', '2019-05-08 17:08:31');
INSERT INTO `xq_line` VALUES ('60', '61', '偏这位女主管再次动了一个弱智手脚。她负责她们部门的机票，6月20号期末考试，她就非把机票订成了6月19号。要么孩子别参加考试跟着父母一起出去旅游。要么父母自己去，别带孩子', '继续60', '2019-05-08 17:08:47');
INSERT INTO `xq_line` VALUES ('61', '62', '被群体攻击时，这位主管还特别不耐烦的说了句“出去玩就是出去玩，带个孩子干什么？乱糟糟的，你们不嫌闹的慌吗？我喜欢清静，我嫌。”', '继续61', '2019-05-08 17:09:01');
INSERT INTO `xq_line` VALUES ('62', '63', '领导这次没法再袒护她了，让别人去处理改签的事，然后挺大动静的当众批评教育她。她回了办公室后，就趴在桌子上哭，是那种崩溃式哭法。哭的时候她说，她的孩子去不了，凭什么别人的孩子就能去。', '继续62', '2019-05-08 17:09:11');
INSERT INTO `xq_line` VALUES ('63', null, '糟糕的婚姻，会把人变的面目全非...', null, '2019-05-08 17:09:11');
INSERT INTO `xq_line` VALUES ('64', '65', ' 我身边最经典的例子，就是我老公一个同学的老婆。', '继续64', '2019-05-08 17:11:34');
INSERT INTO `xq_line` VALUES ('65', '66', '老公的同学李总他开了两家宾馆，还有一个网吧和游戏室，每年的收入在我们这个小县城来说还算蛮可观的。', '继续65', '2019-05-08 17:12:07');
INSERT INTO `xq_line` VALUES ('66', '67', '他老婆慧慧身材苗条，五官也蛮漂亮的，说起话来满脸堆笑，轻言巧语的，一看就是一个贤惠的人。', '继续66', '2019-05-08 17:12:18');
INSERT INTO `xq_line` VALUES ('67', '68', '有一次，老公他们几个同学组织了一次家庭聚会，都带着老婆孩子到户外去烧大锅饭。', '继续67', '2019-05-08 17:12:29');
INSERT INTO `xq_line` VALUES ('68', '69', '我们这些平时不会烧菜的人，围坐在大土灶边的四方桌上吃着水果聊着天，就看到慧慧是忙前忙后，帮着他们一个开饭店的厨师同学打下手，又是洗菜又是切菜的，没有一句怨言。\r\n', '继续68', '2019-05-08 17:12:39');
INSERT INTO `xq_line` VALUES ('69', '70', '她整整忙了一上午，好不容易烧好了一大桌子菜，等我们酒足饭饱，她又主动收拾起桌面上的碗筷来。', '继续69', '2019-05-08 17:12:49');
INSERT INTO `xq_line` VALUES ('70', '71', '这真的是“上得了厅堂，下了得了厨房”，你说，谁娶了这样贤惠的老婆不是福气啊？', '继续70', '2019-05-08 17:13:00');
INSERT INTO `xq_line` VALUES ('71', '72', '最让他们这帮同学羡慕的是，李总家有一男一女两个孩子，女孩漂亮，男孩帅气，大女儿已经上大学了，小儿子还在上初中。', '继续71', '2019-05-08 17:13:11');
INSERT INTO `xq_line` VALUES ('72', '73', '按说，这样的家庭在外人眼里，是不是应该幸福得不得了？', '继续72', '2019-05-08 17:13:19');
INSERT INTO `xq_line` VALUES ('73', '74', '可是，人家李总有钱啊，他天天在外面应酬，基本不着家，在各种娱乐场所夜夜笙歌，花起钱来如流水一般。', '继续73', '2019-05-08 17:13:27');
INSERT INTO `xq_line` VALUES ('74', '75', '李总每月给慧慧一万元家用，其他一概不管，家里的大小事务，接送孩子，照顾公婆全是慧慧一人操持。', '继续74', '2019-05-08 17:13:40');
INSERT INTO `xq_line` VALUES ('75', '76', '有一次，李总在外面包的小三被慧慧发现了，她在家里又是吵又是闹，但是李总根本不拿她当回事，说这是他的自由，慧慧不喜欢的话，她可以走，把孩子留下就行。', '继续75', '2019-05-08 17:13:53');
INSERT INTO `xq_line` VALUES ('76', '77', '慧慧她认为嫁鸡随鸡嫁狗随狗，如果离婚了，会让父母没面子，在村里抬不起头来。再说，她自从结婚后，就没有工作过，脱离社会太久了，她担心自己没有能力养活自己。', '继续76', '2019-05-08 17:14:04');
INSERT INTO `xq_line` VALUES ('77', '78', '她总是自我安慰，为了两个孩子，睁一只眼闭一只眼算了，只要他每月按时给生活费就行了。再说了，现在的男人都一个样，谁不是有钱就变坏，看看周围那些做生意的，哪个没有在外面养小三？', '继续77', '2019-05-08 17:14:16');
INSERT INTO `xq_line` VALUES ('78', '79', '去年年底的时候，我听说慧慧查出来得了乳腺癌。正月的时候，被家人送到大城市做手术化疗去了，目前好像病情已经稳定下来了。', '继续78', '2019-05-08 17:14:28');
INSERT INTO `xq_line` VALUES ('79', '80', '慧慧还这么年轻，我猜她的病肯定是，结婚这些年被李总给气出来的。', '继续79', '2019-05-08 17:14:38');
INSERT INTO `xq_line` VALUES ('80', '81', '结婚后，跟着一个不爱你的人，宁愿忍受他的不好，过一辈子，也不愿离开，没有勇气重新开始新生活。', '继续80', '2019-05-08 17:14:47');
INSERT INTO `xq_line` VALUES ('81', '82', '俗话说，“忍无可忍，无需再忍”，女人最重要的就是要有断舍离的勇气。', '继续81', '2019-05-08 17:14:55');
INSERT INTO `xq_line` VALUES ('82', '83', '就像是不合脚的鞋子，为什么不趁早扔了？而不是忍着痛穿，直到脚被磨出血泡来，这时疼的还不是自己？', '继续82', '2019-05-08 17:15:04');
INSERT INTO `xq_line` VALUES ('83', '84', '我认为，婚姻中不被爱的女人，唯一的出路，是学会断舍离，及时止损。只有学会爱惜自己，让自己变得光芒四射，才能找寻到幸福的出路！', '继续83', '2019-05-08 17:15:15');
INSERT INTO `xq_line` VALUES ('84', null, '愿，婚姻中的你会爱，也被人爱...', '', '2019-05-08 17:16:13');
INSERT INTO `xq_line` VALUES ('85', null, '我的QQ：1668959220\r\n<p>或者点这里，直接进入QQ界面</p>\r\n<p><a class=\"btn btn-info\" href=\"mqqwpa://im/chat?chat_type=wpa&uin=1668959220\" target=\"_blank\">开启临时聊天窗口</a></p>', null, '2019-05-08 17:31:00');
INSERT INTO `xq_line` VALUES ('86', '87', '可能你想问为什么要把缺点表现出来让对方了解一下，很奇怪对吧，其实缺点，每个人都有，或许自己不觉得，但是别人就很难受，有些缺点从小就形成，很难改了，这样就只能找一个能接受的人了', '继续86', '2019-05-08 17:32:10');
INSERT INTO `xq_line` VALUES ('87', null, '如果一次相亲，两个人都表现得很好，相互了解的都是对方的优点，接下来几次见面都是这样的，然后确定关系之后，发现对方的缺点，如果都是不能接受的，那就很不好了', null, '2019-05-08 17:32:10');
INSERT INTO `xq_line` VALUES ('88', '89', '现在，以前玩过的小池塘，再也不敢下去了，都变了，水，很脏，想游泳，去人家专业的游泳池吧。\r\n<p>雪，每年下的时候，看看，回忆一下儿时的快乐，然后，熬过融雪的那一份寒冷，就这...</p>', '继续88', '2019-05-14 14:41:20');
INSERT INTO `xq_line` VALUES ('89', null, '等等，我怎么感觉写着写着就跑题了，伤感的成分都参进来了，我原本想介绍一下我的这个湾子的，好吧算了，就到这里了...', null, '2019-05-14 14:41:20');
INSERT INTO `xq_line` VALUES ('90', '91', '</br></br><img src=\"/files/xq/2019_05/2019-05-18 16_44_04.png\" width=\"100%\"/></br></br>\r\n<p>左边的，应该是男的。</p>\r\n<p>故事开始时，女生就是他的世界（他的全部），“我想环游世界，绕着你转一圈就可以了”。</p>\r\n<p>故事结束时，“没有为什么，就是想骂你两句”。</p>', '继续90', '2019-05-18 16:51:52');
INSERT INTO `xq_line` VALUES ('91', '92', '</br></br><img src=\"/files/xq/2019_05/2019-05-18 16_44_44.jpg\" width=\"100%\"/></br></br>\r\n<p>毕业了就求婚，很直接很大胆的方式，似乎成功得很容易，仅仅是用了一杯奶茶，应该是大学时期的感情基础很好，女孩等着男孩来表白呢</p>\r\n<p>“家里给我介绍了一个对象，准备结婚”，“但是我还是爱你的，真的”，好吧，就让你的人生被家人安排，就让你放弃彼此相爱的人，去和被安排给你的人结婚</p>', '继续91', '2019-05-18 16:55:32');
INSERT INTO `xq_line` VALUES ('92', '93', '</br></br><img src=\"/files/xq/2019_05/2019-05-18 16_48_16.png\" width=\"100%\"/></br></br>\r\n<p>扔出一个红包：“接了就是我的女朋友”，有钱任性，可以，很直接很霸气，然后，也是有点创意的</p>\r\n<p>情感的路上，还是走到了终点，我想，女生是受了很大的委屈，要求吃分手饭，并不是想吃你一顿饭吧，要分手，有些事要说出来；要分手，有些话要说明白；要分手，就要一次性分得干干净净。</p>', '继续92', '2019-05-18 16:55:50');
INSERT INTO `xq_line` VALUES ('93', '94', '</br></br><img src=\"/files/xq/2019_05/2019-05-18 16_48_34.png\" width=\"100%\"/></br></br>\r\n<p>这男的，哎哟不错，很会开玩笑，有点逗，和他在一起，应该是有很多乐子，总能把自己逗笑</p>\r\n<p>可是时间长了，就能看出来，是个花心的货吧，随时都可以嫌女朋友胖了丑了，不多说了</p>\r\n', '继续93', '2019-05-18 16:56:04');
INSERT INTO `xq_line` VALUES ('94', '95', '</br></br><img src=\"/files/xq/2019_05/2019-05-18 16_48_50.jpg\" width=\"100%\"/></br></br>\r\n<p>婚前婚后的差距...</p>\r\n', '继续94', '2019-05-18 16:56:22');
INSERT INTO `xq_line` VALUES ('95', '96', '</br></br><img src=\"/files/xq/2019_05/2019-05-18 16_49_06.jpg\" width=\"100%\"/></br></br>\r\n<p>很有创意的表白，一般女孩就算“识破”这个“小套路”，也愿意“故意中招”</p>\r\n<p>故事的结尾，就只用了一招，反正是能应对所有那一招</p>\r\n', '继续95', '2019-05-18 16:56:35');
