INSERT INTO `xq_tag` VALUES ('1', '1', '继续前的说明', '继续前的说明，我原来以为这里要放很多文字，但是思索再三：“哪有那么多废话啊？简单就是好！”\r\n<p>这个说明就一句话了：“欢迎要相亲的女生来访！”<img src=\"/files/face/1.png\"/></p>', null, null, '2019-05-18 16:33:57');
INSERT INTO `xq_tag` VALUES ('2', '2', '个人信息', '<p>男</p>\r\n<p>1988年</p>\r\n<p>武汉市新洲区人</p>\r\n<p>程序员（PHP语言）</p>\r\n<p>大专</p>\r\n<p>不抽烟，很少喝酒。喜欢听音乐、看电影、晨练、注重养生、尽可能的规律作息</p>\r\n<p>家庭经济条件一般，无欠外账无贷款，父母身体健康并且有一定的经济收入</p>', null, null, '2019-05-04 15:53:11');
INSERT INTO `xq_tag` VALUES ('3', '2', '爆照', '哈哈，我就知道你很快就要点这个标签，其实吧，我对自己的颜值也没有多大的自信，但是这里不放个“爆照”标签你肯定是不满意的', '1', '爆照', '2019-05-04 15:55:58');
INSERT INTO `xq_tag` VALUES ('4', '2', '经济能力', '这里我说一个大概，目前结合我的家庭情况，婚后保证小家庭的正常温饱生活是没什么问题的，有奢侈品需求的，或其他高消费的，找我作为结婚对象肯定是不合适的', '2', '继续', '2019-05-04 15:58:07');
INSERT INTO `xq_tag` VALUES ('5', '2', '我对女生的要求', '每个人性格不一，同一个东西，或许有的人很喜欢，有的人却很不喜欢，相亲对象，是有可能要过一辈子的，所以，对对方多少还是要有点要求的', '4', '继续', '2019-05-04 16:01:06');
INSERT INTO `xq_tag` VALUES ('6', '3', '新洲', '在我的老家新洲，山永远都是绿的，水永远都是清的，从我的老家新洲到湖北省会武汉，要跨过一条长长的举水河，河的源头，就是有名的长江，十年前，我就是跨过这条长长的举水河来到武汉的...', '8', '继续', '2019-05-04 16:07:57');
INSERT INTO `xq_tag` VALUES ('7', '3', '我所在的那个湾子', '农村嘛，某市，某区，某村，然后就是某湾子了，写到这里，突然感觉没什么好写的了，不都差不多吗，不过既然创建了这个标签，还是写点东西', '10', '继续', '2019-05-04 16:22:26');
INSERT INTO `xq_tag` VALUES ('8', '4', '工作方面的', '工作上的计划嘛，当然不是一直这么打工下去了，到后面，我会在我的老家新洲开一个小门店，搞广告业务，当然那些打字复印的都要带上', '14', '你为什么想做这个呢', '2019-05-04 17:08:32');
INSERT INTO `xq_tag` VALUES ('9', '4', '家庭方面的', '我想找一个“你懂我，我也懂你”的对象，平平淡淡的过下半辈子，不求有多好的物质享受，只求有一个温馨的窝，满满的幸福感。', '19', '继续', '2019-05-04 17:11:08');
INSERT INTO `xq_tag` VALUES ('10', '5', '简介', '我的感情经历就比较简单了，两段，一个是大学时的初恋，感情很纯很深的那种；再一个就是2015年前后，在上海，有那么一瞬间，想定终身的，可最后还是散了...', null, null, '2019-05-04 17:14:01');
INSERT INTO `xq_tag` VALUES ('11', '5', '我的初恋', '我有时候也是比较随性，做这个的时候，就是想到哪儿就写到哪儿，我新增了个“感情篇”大分类，然后在这个大分类里创建了一个“我的初恋”标签，再然后...', '21', '再然后怎么了？', '2019-05-04 17:14:40');
INSERT INTO `xq_tag` VALUES ('12', '5', '上海的那个女孩', '上海的那个女孩（雯雯），我的第二段感情经历，小巧玲珑型，很单纯，最后分手，一半的原因是因为地域关系（她安徽的，我武汉的）；另一半就是她和她的前任还没有彻底断关系。', '24', '那你怎么还要和她谈朋友呢', '2019-05-04 17:16:21');
INSERT INTO `xq_tag` VALUES ('13', '5', '安静的把它看完', '我们都很现实，安静的把它看完', '42', '继续', '2019-05-04 17:22:14');
INSERT INTO `xq_tag` VALUES ('14', '6', '说明', '新建了这个大分类，原来是想“一首歌一个故事”的，但是，歌有了，故事呢？\r\n<p>算了，这里就给大家推荐几首歌听听吧</p>', null, null, '2019-05-04 17:24:54');
INSERT INTO `xq_tag` VALUES ('15', '6', '你会爱到到什么时候', '</br></br>你会爱到到什么时候:</br></br><audio autoplay=\"autoplay\" loop=\"loop\" controls=\"controls\" src=\"/files/xq/2019_05/2019-05-04 17_25_57.mp3\">Your browser does not support music playback</audio></br></br>\r\n<p>这首歌，有人写下这样的留言：知道你要结婚了，我开了一千多公里的车，来到你家楼下，那天你很美，真的很美，鞭炮响起，我知道接亲的车来了，我悄悄跟在车队后面，车开了十一公里，停了下来，手机收到你的短信，别送了，我到了，这辈子就到这儿吧，从来不知泪水滋味的我顿时泪如雨下……</p>\r\n<p>安静的把它听完</p>\r\n</br></br>\r\n<p>忘了是什么时候</p>\r\n<p>习惯了一些问候</p>\r\n<p>听老情歌 最后一首</p>\r\n<p>轻轻的唇在颤抖</p>\r\n<p>时间像无边的海</p>\r\n<p>我们在无力地游</p>\r\n<p>思念在前后 焦心在左右</p>\r\n<p>谁在挥舞着衣袖</p>\r\n<p>你会爱我到什么时候</p>\r\n<p>你会陪我到哪个路口</p>\r\n<p>我不知道用什么理由</p>\r\n<p>让你可以和我厮守到白头</p>\r\n<p>你会爱我到什么时候</p>\r\n<p>你会等我到哪座桥头</p>\r\n<p>我只剩下这一颗红豆</p>\r\n<p>请你把它收下 别让风带走</p>\r\n<p>时间像无边的海</p>\r\n<p>我们在无力地游</p>\r\n<p>思念在前后 焦心在左右</p>\r\n<p>谁在挥舞着衣袖</p>\r\n<p>Ha...</p>\r\n<p>你会爱我到什么时候</p>\r\n<p>你会陪我到哪个路口</p>\r\n<p>我不知道用什么理由</p>\r\n<p>让你可以和我厮守到白头</p>\r\n<p>你会爱我到什么时候</p>\r\n<p>你会等我到哪座桥头</p>\r\n<p>我只剩下这一颗红豆</p>\r\n<p>请你把它收下 别让风带走</p>\r\n<p>你会爱我到什么时候</p>\r\n<p>你会陪我到哪个路口</p>\r\n<p>我不知道用什么理由</p>\r\n<p>让你可以和我厮守到白头</p>\r\n<p>你会爱我到什么时候</p>\r\n<p>你会等我到哪座桥头</p>\r\n<p>我只剩下这一颗红豆</p>\r\n<p>请你把它收下 别让风带走</p>\r\n<p>请你把它收下</p>\r\n<p>别让风带走</p>', null, null, '2019-05-04 17:29:07');
INSERT INTO `xq_tag` VALUES ('16', '6', '很任性', '<p>这首歌，就好像真实的刻画了一个平时很任性的女孩，以为在爱情面前也能很任性</p>\r\n<p>可是她错了，她发现自己在爱情面前，任性不起来了，原来很任性的自己，也是很脆弱的...</p>', '47', '继续', '2019-05-08 14:08:24');
INSERT INTO `xq_tag` VALUES ('17', '7', '婚姻里，不被爱的女人会越来越丑陋', '在婚姻中，得不到爱，得不到认可的女人，会把一腔热情投入到儿女身上。通过儿女来证明自己的价值。大多数啃老家庭，都是夫妻关系不够好的家庭。爸爸的心思大多放在娘家，一小部份放在孩子身上。妈妈只能把自己的全部爱投入到孩子身上，用孩子来完善自己在婆家的地位。', '48', '继续', '2019-05-08 16:54:04');
INSERT INTO `xq_tag` VALUES ('18', '7', '婚姻里，不被爱的女人最可怜', '“ 愿，婚姻中的你会爱，也被人爱。 ”', '64', '继续', '2019-05-08 17:11:09');
