INSERT INTO `xq_tag` VALUES ('20', '8', '你觉得我们比较合适', '如果，你觉得我们比较合适，那我们可以进一步了解一下吧，最好先QQ', '85', '继续', '2019-05-08 17:31:00');
INSERT INTO `xq_tag` VALUES ('21', '8', '想和我见一下面', '如果想和我见一下面，好的，请随意一点，尽量表现出平常生活中的自己。商业圈子交朋友需要了解对方的优势，以便以后有需要的时候能够用得上，但是相亲就不一样了，了解对方的时候，优点和缺点一起了解是最好的。', '86', '继续', '2019-05-08 17:31:47');
INSERT INTO `xq_tag` VALUES ('22', '5', '一张图一段恋情', '很多爱情，都是从微信聊起来的，一般都是男生找女生聊，似乎很多，都能聊成恋人，然后，就有了一段故事，只是，故事的开始，很美好，故事的结局，却是那么的伤感...', '90', '继续', '2019-05-18 16:50:31');
